import React from 'react';
import classes from './Contact.module.css';

class Contact extends React.Component {
    render() {
        return (
            <div className={classes.Contact}>
                <div className={classes.Content}>
                    <h1>Contact <span>Me</span></h1>
                    {/*<div className={classes.Bar}></div>}*/}
                    <div className={classes.Content2}>
                        <p>If you any questions are or are interested in working with me, I would love to hear from you. You can contact me with either of the methods below.</p>
                        <div className={classes.ContactMethods}>
                            <p>Email: azforest44@gmail.com</p>
                            <p>Phone: (916) 412-1799</p>
                            <p>LinkedIn</p>
                        </div>
                    </div>
                </div>

            </div>
        )
    }
}

export default Contact;
